uid: microsoft.quantum.math.dividedbyi
name: DividedByI
type: function
namespace: Microsoft.Quantum.Math
summary: 返回两个输入的商。
syntax: 'function DividedByI (a : Int, b : Int) : Int'
input:
  content: '(a : Int, b : Int)'
  types:
  - name: a
    summary: 要相除的第一个输入 $a $。
    isPrimitive: true
    uid: Int
  - name: b
    summary: 要相除 $b $ 的第二个输入。
    isPrimitive: true
    uid: Int
output:
  content: Int
  types:
  - summary: 商 $a/b $。
    isPrimitive: true
    uid: Int
